			shellPath = /bin/sh;
			shellScript = "#!/bin/bash\n\n# 配置参数\nSDK_NAME=\"ElitechTool\"\nCONFIGURATION=\"Release\"\nSCHEME_NAME=\"ElitechTool\"\nPROJECT_NAME=\"ElitechTool.xcodeproj\"\n\n# 输出目录设置\nBUILD_DIR=\"build\"\nOUTPUT_DIR=\"Distribution/${SDK_NAME}\"\nFRAMEWORK_DIR=\"${OUTPUT_DIR}/Frameworks\"\nDOCS_DIR=\"${OUTPUT_DIR}/Documentation\"\n\n# 清理并创建目录\nrm -rf \"${OUTPUT_DIR}\"\nmkdir -p \"${FRAMEWORK_DIR}\"\nmkdir -p \"${DOCS_DIR}\"\n\n# 构建iOS设备架构\nxcodebuild \\\n    -UseModernBuildSystem=NO \\\n    -project \"${PROJECT_NAME}\" \\\n    -scheme \"${SCHEME_NAME}\" \\\n    -configuration \"${CONFIGURATION}\" \\\n    -sdk iphoneos \\\n    BUILD_DIR=\"${BUILD_DIR}\" \\\n    clean build\n\n# 构建iOS模拟器架构\nxcodebuild \\\n    -UseModernBuildSystem=NO \\\n    -project \"${PROJECT_NAME}\" \\\n    -scheme \"${SCHEME_NAME}\" \\\n    -configuration \"${CONFIGURATION}\" \\\n    -sdk iphonesimulator \\\n    BUILD_DIR=\"${BUILD_DIR}\" \\\n    clean build\n\n# 查找生成的framework\nDEVICE_FRAMEWORK=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${SDK_NAME}.framework\"\nSIMULATOR_FRAMEWORK=\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${SDK_NAME}.framework\"\nUNIVERSAL_FRAMEWORK=\"${FRAMEWORK_DIR}/${SDK_NAME}.framework\"\n\n# 创建通用framework目录结构\nmkdir -p \"${UNIVERSAL_FRAMEWORK}\"\n\n# 拷贝设备framework的文件到通用目录\ncp -R \"${DEVICE_FRAMEWORK}/\" \"${UNIVERSAL_FRAMEWORK}/\"\n\n# 合并二进制文件\nlipo -create \\\n    \"${DEVICE_FRAMEWORK}/${SDK_NAME}\" \\\n    \"${SIMULATOR_FRAMEWORK}/${SDK_NAME}\" \\\n    -output \"${UNIVERSAL_FRAMEWORK}/${SDK_NAME}\"\n\n# 拷贝Swift模块（如果有）\nif [ -d \"${SIMULATOR_FRAMEWORK}/Modules/${SDK_NAME}.swiftmodule\" ]; then\n    cp -R \"${SIMULATOR_FRAMEWORK}/Modules/${SDK_NAME}.swiftmodule/\" \"${UNIVERSAL_FRAMEWORK}/Modules/${SDK_NAME}.swiftmodule/\"\nfi\n\n# 生成文档（可选）\n#jazzy \\\n    --module ${SDK_NAME} \\\n    --output \"${DOCS_DIR}\" \\\n    --theme apple\n\n# 复制LICENSE和README文件\ncp \"LICENSE\" \"${OUTPUT_DIR}/\"\ncp \"README.md\" \"${OUTPUT_DIR}/\"\n\n# 创建版本信息文件\necho \"SDK Version: 1.0.1\" > \"${OUTPUT_DIR}/VERSION\"\necho \"Build Date: $(date)\" >> \"${OUTPUT_DIR}/VERSION\"\n\n# 打包成ZIP\ncd \"${OUTPUT_DIR}\"\nzip -r \"../${SDK_NAME}-$(date +%Y%m%d).zip\" .\n\necho \"SDK打包完成！输出文件: Distribution/${SDK_NAME}-$(date +%Y%m%d).zip\"\n";
